import PreAppSecond from './PreAppSecond';
import {Route,Switch} from 'react-router-dom'
import Register from './CommonApps/Register';


const PreAppFirst=()=>{



return (

<div>

<Switch>

   <Route exact path='/createaccount/' >
        <Register/>
   </Route>


   <Route  path='/' >
        <PreAppSecond/>
   </Route>	




</Switch>




</div>
);
}

export default PreAppFirst;
